import React from 'react'
import Movie_card from './Movie_card/Movie_card';


const Movie_list = ({ moviesList }) => {
return(
  <div
      style={{
        display: 'flex',
        flexDirection: 'row',
        justifyContent: 'space-evenly',
        flexWrap: 'wrap',
      }}
    >
    {Movie_list.map((el, i) => (
          <Movie_card key={i} movie={el} />
        ))}
    </div>

);
};
export default Movie_list;
